import 'cypress-file-upload'
describe('Image Upload in Profile Details Section', () => {
  describe('given the user is logged in with an empty account', () => {
    beforeEach(() => {
      cy.login('mihai.maxim+empty@thinslices.com', 'password1234')
    })

    it('should upload an image, verify format and size, and update base64 values', () => {
      cy.visit('http://localhost:3000/dashboard')
      cy.viewport(1600, 800)

      cy.get('[data-cy="nav-profile-section-button"]').click()

      const imagePath = 'dog-profile.jpeg'
      const base64Image =
        'url("data:image/jpeg;base64,") center center / cover no-repeat'

      cy.fixture(imagePath).then((fileContent) => {
        cy.get(
          '[data-cy="update-profile-section-image-upload-zone-input"]',
        ).attachFile(
          {
            fileContent: fileContent.toString(),
            fileName: imagePath,
            mimeType: 'image/jpeg',
          },
          { subjectType: 'input' },
        )
      })

      cy.wait(30000)

      cy.get('[data-cy="nav-customize-links-profile-picture-placeholder"]')
        .invoke('attr', 'style')
        .should('include', base64Image)
      cy.get('[data-cy="update-profile-section-image-upload-zone"]')
        .invoke('attr', 'style')
        .should('include', base64Image)
    })
  })
})
